import { useState } from "react";

var WhishList = () => {
  const [whislistButton, setWhishlistButton] = useState("Whislist");

  function handleClick() {
    setWhishlistButton("Added to WhishList");
  }

  return (
    <>
    <div 
      style={{
        position: "Fixed",
        boxShadow: "3px 3px 5px black",
        zIndex: "1",
        top: "20%",
        left: "25%",
        backgroundColor: "white",
        width: "50%",
        height: "50%",
      }}
    
    > <button onClick={handleClick}>{whislistButton}</button>
    </div>
    </>
  );
};

export default WhishList;
